INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 7, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 7001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 7, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 7002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 7, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 7003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 10, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 10001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 10, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 10002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 10, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 10003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 10, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 10004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 1, 12, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 12001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 13, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 13001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 13, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 13002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 13, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 13003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 13, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 13004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 14, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 14001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 14, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 14002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 14, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 14003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 14, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 14004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, 1, 15, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 15001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 16, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 16001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 16, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 16002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 16, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 16003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 16, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 16004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 17, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 17002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 25, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 17004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 25, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 17005, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 25, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 17006, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 25, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 17007, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 18, 0, "カリン", 0, 1, 190801, 1, 0.0, 0.0, 18001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 18, 0, "カリン", 0, 2, 190801, 1, 0.0, 0.0, 18002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, 1, 19, 0, "カリン", 0, 3, 190801, 1, 0.0, 0.0, 19001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, 1, 19, 0, "カリン", 0, 4, 190801, 1, 0.0, 0.0, 19002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, 1, 20, 0, "カリン", 0, 5, 190801, 1, 0.0, 0.0, 20001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-470.0, 1, 20, 0, "カリン", 0, 6, 190801, 1, 0.0, 0.0, 20002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 21, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 21001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 21, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 21002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 21, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 21003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 21, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 21004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, 1, 22, 0, "カリン", 0, 1, 190801, 1, 0.0, 0.0, 22001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, 1, 22, 0, "カリン", 0, 2, 190801, 1, 0.0, 0.0, 22002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, 1, 23, 0, "カリン", 0, 3, 190801, 1, 0.0, 0.0, 23001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-430.0, 1, 23, 0, "カリン", 0, 4, 190801, 1, 0.0, 0.0, 23002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "エリコ（バレンタイン）", 0, 1, 109001, 1, 8.0, 4.08, 24001, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "エリコ（バレンタイン）", 0, 2, 109001, 1, 8.0, 5.0, 24002, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "エリコ（バレンタイン）", 0, 3, 109001, 1, 8.0, 10.11, 24003, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "エリコ（バレンタイン）", 0, 4, 109001, 1, 8.0, 4.0, 24004, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "エリコ（バレンタイン）", 0, 5, 109001, 1, 8.0, 6.0, 24005, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "エリコ（バレンタイン）", 0, 6, 109002, 1, 0.0, 0.0, 24006, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "エリコ（バレンタイン）", 0, 7, 109002, 1, 0.0, 0.0, 24007, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "エリコ（バレンタイン）", 0, 8, 109002, 1, 0.0, 0.0, 24008, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "エリコ（バレンタイン）", 0, 9, 109002, 1, 0.0, 0.0, 24009, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "エリコ（バレンタイン）", 0, 10, 109002, 1, 0.0, 0.0, 24010, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "シズル（バレンタイン）", 0, 1, 109101, 1, 8.0, 2.12, 24011, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "シズル（バレンタイン）", 0, 2, 109101, 5, 8.0, 4.19, 24012, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 4, 24, 10011, "シズル（バレンタイン）", 0, 3, 109101, 2, 8.0, 2.3, 24013, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "シズル（バレンタイン）", 0, 4, 109102, 1, 0.0, 0.0, 24014, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "シズル（バレンタイン）", 0, 5, 109101, 5, 8.0, 5.23, 24015, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "シズル（バレンタイン）", 0, 6, 109102, 1, 0.0, 0.0, 24016, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-385.0, 2, 24, 10011, "シズル（バレンタイン）", 0, 7, 109101, 1, 8.0, 5.01, 24017, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "シズル（バレンタイン）", 0, 8, 109102, 1, 0.0, 0.0, 24018, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "シズル（バレンタイン）", 0, 9, 109102, 1, 0.0, 0.0, 24019, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (0.0, 1, 24, 10011, "シズル（バレンタイン）", 0, 10, 109102, 1, 0.0, 0.0, 24020, "2019/01/31 12:00:00", "2030/12/17 14:59:59", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 26, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 26001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 26, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 26002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 26, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 26003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 26, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 26004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 27, 0, "シェフィ", 2104010, 1, 106401, 2, 0.0, 0.0, 27001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 27, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 27002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 27, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 27003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 27, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 27004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 28, 0, "カリン", 0, 1, 190801, 1, 0.0, 0.0, 28001, "2019/09/24 15:00:00", "2030/12/17 14:59:59", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 28, 0, "カリン", 0, 2, 190801, 1, 0.0, 0.0, 28002, "2019/09/24 15:00:00", "2030/12/17 14:59:59", "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 29, 0, "カリン", 0, 3, 190801, 1, 0.0, 0.0, 29001, "2019/09/24 15:00:00", "2030/12/17 14:59:59", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 29, 0, "カリン", 0, 4, 190801, 1, 0.0, 0.0, 29002, "2019/09/24 15:00:00", "2030/12/17 14:59:59", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 30, 0, "カリン", 0, 5, 190801, 1, 0.0, 0.0, 30001, "2019/09/24 15:00:00", "2030/12/17 14:59:59", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！");
