INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 31, 0, "カリン", 0, 7, 190801, 1, 0.0, 0.0, 31001, "2019/10/31 12:00:00", "2030/12/17 14:59:59", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
