INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 33, 0, "カリン", 0, 4, 190801, 1, 0.0, 0.0, 33002, "2019/12/20 5:00:00", "2020/01/04 4:59:59", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
