INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-409.0, 1, 34, 0, "カリン", 0, 6, 190801, 1, 0.0, 0.0, 34002, "2020/01/04 5:00:00", "2020/01/10 11:59:59", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！");
