INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 41, 0, "シェフィ", 2104010, 1, 106401, 1, 0.0, 0.0, 41001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。");
