INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 41, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 41003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 41, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 41004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 1, 42, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 42001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
