INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 1, 42, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 42004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 43, 0, "ペコリーヌ", 0, 1, 105801, 1, 0.0, 0.0, 43001, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 43, 0, "コッコロ", 0, 1, 105901, 1, 0.0, 0.0, 43002, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-363.0, 1, 43, 0, "キャル", 0, 1, 106001, 1, 0.0, 0.0, 43003, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 1, 44, 0, "アメス", 0, 1, 123001, 1, 0.0, 0.0, 43004, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 1, 44, 0, "アメス", 0, 2, 123001, 1, 0.0, 0.0, 43005, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_775d6254a27d30bb698c23dead861d757174c3fba66c5611367819ebe816eade` VALUES (-416.5, 2, 45, 0, "アメス", 0, 3, 123001, 1, 0.0, 5.79, 43006, "2015/12/17 15:00:00", "2030/12/17 14:59:59", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
